class Logger:
    def __init__(self):
        logging.basicConfig(level=logging.INFO)

    def log_message(self, message):
        logging.info(message)

class Broker:
    def __init__(self):
        self.uploaded_files = []

    def upload_file(self, file):
        try:
            logging.info(f"Uploading file {file}")
            # Simulating file upload
            self.uploaded_files.append(file)
            print(f"File {file} uploaded successfully")
        except Exception as e:
            logging.error(f"Error uploading file {file}: {e}")

    def validate_error_message(self, file):
        try:
            logging.info(f"Validating error message for file {file}")
            # Simulating error message validation
            print(f"Error message for file {file} validated successfully")
        except Exception as e:
            logging.error(f"Error validating error message for file {file}: {e}")

